import React, { Component } from 'react';
import Link from 'next/link';
import logo from '../static/logo.png';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card, CardText, CardHeader, CardBody, Button } from 'reactstrap';

class Header extends Component{

    render(){
        return(

            <div >
                <nav className = 'navbar'>
                    <div className = 'container-fluid'>
                    <Logo/>
                    <SearchBox/>
                    <Menu/>
                    </div>
                </nav>

                <style jsx>{`
                    div{
                        background: #004650;
                    }
                `}</style>
            </div>
        );
    }
}

const Logo = props => (
    <div className = 'navbar-header'>
        <Link href = '#'>
            <a className = 'navbar-brand'>
                        <img src={logo} alt = ''/>
            </a>
        </Link>
        <style jsx>{`
                    img{
                        width: 40px;
                        height: 40px;
                        background: #004650;
                    }

                `}</style>


    </div>
);

const MenuButton = props =>(
    <Link href = {`${props.href}`}>
        <li className = 'nav-item'><a className = 'nav-link'>{`${props.name}`}</a></li> 
    </Link>
);

const Menu = props =>(
    <ul className = 'nav'>
        <MenuButton name = 'Main' href = '#'/>
        <MenuButton name = 'Songs' href = '#'/>
        <MenuButton name = 'Compositors' href = '#'/>
        <MenuButton name = 'Chords' href = '#'/>
        <MenuButton name = 'Articles' href = '#'/>
    </ul>


);

const SearchBox = props =>(
    <form class="navbar-form" role="search">
    <div class="input-group add-on">
      <input class="form-control" placeholder="Search" name="srch-term" id="srch-term" type="text"/>
      <div class="input-group-btn">
        <button class="btn btn-default" type="submit"><i class="glyphicon glyphicon-search"></i></button>
      </div>
    </div>
  </form>
);

export default Header;
